import { useState, useEffect } from 'react';
import axios from 'axios';

function App() {
  const [people, setPeople] = useState([]);

  useEffect(async () => {
    try {
      const response = await axios('api/test-api');
      console.log(response);
      setPeople(response.data);
    } catch (e) {
      console.error(e);
    }
  });

  return (
    <>
      <pre>{people}</pre>
    </>
  );
}

export default App;
